import styled from 'styled-components';
import Layout from 'components/Layout';

const PatternLockSettingWrapper = styled(Layout)`
  
  .passwordArea {
    margin-top: 2rem;
  }
  
  .customSpace {
    margin-top: .8rem;
    margin-bottom: .4rem;
  }
`;

export default PatternLockSettingWrapper;
